    Omit<PlasmicSubscriberCard__VariantsArgs, ReservedPropsType> &
    // Specify args directly as props
    Omit<PlasmicSubscriberCard__ArgsType, ReservedPropsType> &
    // Specify overrides for each element directly as props
    Omit<
      NodeOverridesType<T>,
      ReservedPropsType | VariantPropType | ArgPropType
